import React from 'react'
import NavbarUser from '../../layouts/NavbarUser'
import { useSelector } from 'react-redux'

const UserHome = () => {
  const {user} = useSelector((state)=>({...state}))
  return (
    <div>
      <NavbarUser/>
      <h1>Welcome {user.firstname} {user.lastname}</h1>
    </div>
  )
}

export default UserHome
